export class HeaderComponent {

}
<header>
    <div class="container">
        <a href="#" routerLink="/" class="logo">TC @ Food Corner!</a>
        <nav>
            <ul>
                <li>
                    <a href="#" routerLink="/cart-page">Cart</a>
                </li>
            </ul>
        </nav>
    </div>
</header>
